// Populate vacationGrids using the parsed CSV data
for (const key in csvData) {
  if (csvData.hasOwnProperty(key)) {
    let dayKey, seasonKey;

    // Determine the day and season from the CSV filename convention
    if (key.startsWith("Dim")) {
      dayKey = "Dim";
      seasonKey = key.substring(3); // e.g., "Cha", "Cre", "Hiv"
    } else if (key.startsWith("Sam")) {
      dayKey = "Sam";
      seasonKey = key.substring(3);
    } else if (key.startsWith("Sem")) {
      dayKey = "Sem";
      seasonKey = key.substring(3);
    } else {
      console.warn(`Unknown CSV data key format: ${key}. Skipping.`);
      continue;
    }

    // Assign the parsed data to the correct location in vacationGrids
    if (vacationGrids[dayKey] && vacationGrids[dayKey][seasonKey]) {
      vacationGrids[dayKey][seasonKey] = {
        name: key, // e.g., "DimCha"
        grid: parseCsv(csvData[key])
      };
    } else {
      console.error(`Invalid structure for day: ${dayKey}, season: ${seasonKey}. Please check vacationGrids object.`);
    }
  }
}

